import { registerIcon } from "@ui5/webcomponents-base/dist/SVGIconRegistry.js";

const name = "sort-descending";
const pathData = "M65 192h383l-15 32H82zM17 96h478l-15 32H34zm367 224H129l-16-32h287zm-47 96H177l-16-32h192z";

registerIcon(name, { pathData });

export default { pathData };
